parsed_data = []
for group in netog_data:
    group_name = group["name"]
    group_type = group["type"]
    description = group.get("description", "")
    domain_name = group["metadata"]["domain"]["name"]
    domain_id = group["metadata"]["domain"]["id"]

    # Process literals
    for literal in group.get("literals", []):
        parsed_data.append([
            group_name, group_type, description, domain_name, domain_id,
            literal["type"], literal["value"], "N/A", "N/A"
        ])

    # Process objects
    for obj in group.get("objects", []):
        parsed_data.append([
            group_name, group_type, description, domain_name, domain_id,
            obj["type"], "N/A", obj["id"], obj["name"]
        ])

# Define the output file path
full_output_file_path = "full_network_group_data.csv"

# Write to a CSV file
with open(full_output_file_path, mode='w', newline='') as file:
    writer = csv.writer(file)
    # Write header
    writer.writerow([
        "Group Name", "Group Type", "Description", "Domain Name", "Domain ID",
        "Attribute Type", "Literal Value", "Object ID", "Object Name"
    ])
    # Write data
    writer.writerows(parsed_data)

